                <textarea placeholder='Ваше сообщение' value={enteredMessage} onChange={event => setEnteredMessage(event.target.value)}> </textarea>
            </div>

            <button className='submit__btn' type='submit'>
                Отправить
            </button>
        </form>
    )
}

export default Form
